import styled from 'styled-components';

export const DetailWrapper = styled.div`
    overflow:hidden;
    width:960px;
    margin:0 auto;
    padding-bottom:100px;
    background:red;
`;
export const Header = styled.div`
    margin:50px 0 20px 0;
    font-size:44px;
    line-height:34px;
    color:#333;
    font-weight:bold;
`;
